import { useState } from "react";

const Edit = ({ onInputChange }) => {
  const [number, setNumber] = useState("");
  const [name, setName] = useState("");
  const [dep, setDep] = useState("");
  const [address, setAddress] = useState("");

  function numberChange(e) {
    const value = e.target.value;
    setNumber(value);
    onInputChange("number", value);
  }

  function nameChange(e) {
    const value = e.target.value;
    setName(value);
    onInputChange("name", value);
  }

  function depChange(e) {
    const value = e.target.value;
    setDep(value);
    onInputChange("dep", value);
  }

  function addressChange(e) {
    const value = e.target.value;
    setAddress(value);
    onInputChange("address", value);
  }

  // 其他程式碼...

  return (
    <div>
      <h1>學生資料</h1>
      <p>學號：</p>
      <input type="text" value={number} onChange={numberChange} />
      <p>姓名：</p>
      <input type="text" value={name} onChange={nameChange} />
      <p>系所：</p>
      <input type="text" value={dep} onChange={depChange} />
      <p>錢包地址：</p>
      <input type="text" value={address} onChange={addressChange} />
    </div>
  );
};

export default Edit;
